import ContactPerson from "./ContactPerson";
import classes from "./ContactList.module.css";

function ContactList() {
    return (
        <>
            <h2 className={classes.title}>聊天室</h2>
            <ul>
                <ContactPerson />
                <ContactPerson />
                <ContactPerson />
                <ContactPerson />
                <ContactPerson />
                <ContactPerson />
                <ContactPerson />
                <ContactPerson />
                <ContactPerson />
                <ContactPerson />
                <ContactPerson />
                
            </ul>
        </>
    );
}

export default ContactList;
